    ];
    HabitItem::insert($items_group10);
    HabitItem::insert($items_group11);

    // 期限切れのデータをセット
    $habitItemId = HabitItem::where('group_id', '=', 10)->where('name', '=', '【掃除】　浴室換気扇')->get()->first()->id;
    HabitSchedule::insert(['habit_item_id' => $habitItemId, 'created_at' => $now, 'updated_at' => $now, 'scheduled_date' => $beginningOfTheMonth->format('Y-m-d'), 'isComplete' => 0]);
