    HabitSchedule::insert(['habit_item_id' => $habitItemId, 'created_at' => $now, 'updated_at' => $now, 'scheduled_date' => $beginningOfTheMonth->format('Y-m-d'), 'isComplete' => 0]);

    // 完了済のデータ作成
    $habitItemId = HabitItem::where('group_id', '=', 10)->where('name', '=', '【掃除】　窓ふき')->get()->first()->id;
    HabitSchedule::insert(['habit_item_id' => $habitItemId, 'created_at' => $now, 'updated_at' => $now, 'scheduled_date' => $yesterday->format('Y-m-d'), 'isComplete' => 1]);

    // HabitItem の情報を基に HabitSchedule へインサート
    $habitItemController = new HabitItemController();
    $habitItemController->commonBag['userCurrentGroupId'] = 10;
    $habitItemController->updateHabitSchedules();
    $habitItemController->commonBag['userCurrentGroupId'] = 11;
    $habitItemController->updateHabitSchedules();
}

